import React from 'react';
import SearchFormLabel from './SearchFormLabel/SearchFormLabel';
import ContactButton from './ContactButton/ContactButton';

const ContactForm = props => {

  const searchLabels = props.labels.map((label, index) => {
    return <SearchFormLabel
      name={label.id}
      value={label.val}
      changed={(event) => props.changed(event, label.id)}
      key={label.id} />         
  });

  return (
    <form>
      { props.children }
      <div>
        {searchLabels}
        <ContactButton clicked={props.submit} />

      </div>
    </form>
  );
}


export default ContactForm;
